import React, { useState } from 'react';
import './ViewDocDetail.css';

export default function ViewDocDetail() {
    // Dummy data for the doctor's profile
    const profile = {
        avatar: 'path_to_image',
        fullname: 'Nguyễn Văn Bác Sĩ',
        qualification: 'Certificate 1',
        experiences: 'Experience 1',
    };

    const [selectedDate, setSelectedDate] = useState('');

    const handleDateChange = (event) => {
        setSelectedDate(event.target.value);
    };

    return (
        <div className="container">
            <div className="doctor-profile">
                <img src={profile.avatar} alt="Doctor Profile" className="profile-picture" />
                <h2 className="doctor-name">{profile.fullname}</h2>
                
            </div>

            <div className="doctor-information">
                <h3>Thông tin bác sĩ</h3>
                <div className="info-item">
                    <h4>Chứng chỉ:</h4>
                    <p>{profile.qualification}</p>
                </div>
                <div className="info-item">
                    <h4>Kinh nghiệm:</h4>
                    <p>{profile.experiences}</p>
                </div>
            </div>
        </div>
    );
}
